// 482. 密钥格式化 easy

//给定一个密钥字符串S，只包含字母，数字以及 '-'（破折号）。N 个 '-' 将字符串分成了 N+1 组。给定一个数字 K，重新格式化字符串，除了第一个分组以外，每个分组要包含 K 个字符，第一个分组至少要包含 1 个字符。两个分组之间用 '-'（破折号）隔开，并且将所有的小写字母转换为大写字母。
//
// 给定非空字符串 S 和数字 K，按照上面描述的规则进行格式化。
//
// 示例 1：
//
// 输入：S = "5F3Z-2e-9-w", K = 4
//
// 输出："5F3Z-2E9W"
//
// 解释：字符串 S 被分成了两个部分，每部分 4 个字符；
//      注意，两个额外的破折号需要删掉。
// 示例 2：
//
// 输入：S = "2-5g-3-J", K = 2
//
// 输出："2-5G-3J"
//
// 解释：字符串 S 被分成了 3 个部分，按照前面的规则描述，第一部分的字符可以少于给定的数量，其余部分皆为 2 个字符。
//  
//
// 提示:
//
// S 的长度不超过 12,000，K 为正整数
// S 只包含字母数字（a-z，A-Z，0-9）以及破折号'-'
// S 非空
//

/**
 * 我的解法超时
 * @param {string} S
 * @param {number} K
 * @return {string}
 */
var licenseKeyFormatting = function(S, K) {
    S = S.replace(/-/g, '').toUpperCase();
    let arr = S.split('');

    // 加破折号
    let nArr = [];
    let n = 0;
    for (let i = arr.length - 1; i >= 0; i--) {
        n++;
        nArr.unshift(arr[i]);
        if(n === K && i !== 0){
            nArr.unshift('-');
            n = 0;
        }
    }
    return nArr.join('')
};


// 别人的解法不超时
var aaa = (S, K) => {
    let valids = S.toUpperCase().replace(/-/g, '') // 所有有效字符
    const befores = valids.slice(0, valids.length % K);// 剔除取模的前面部分字符串
    afterValids = valids.slice(befores.length);// 剩余整除部分字符串
    let afters = '';// 后面部分的格式化字符串
    if (afterValids) {
        afters = afterValids.match(new RegExp(`.{${K}}`, 'g')).join('-');
    }
    if (befores && afters) {
        return befores + '-' + afters;
    } else if (befores) {
        return befores
    } else {
        return afters;
    }
}
